import { useLocation } from 'react-router-dom';
import styled from 'styled-components';
import Announcement from '../components/Announcement';
import Footer from '../components/Footer';
import Navbar from '../components/Navbar';
import Newsletter from '../components/Newsletter';
import RemoveIcon from '@mui/icons-material/Remove';
import AddIcon from '@mui/icons-material/Add';
import { mobile } from '../responsive';
import { useEffect, useState } from 'react';
import { publicRequest } from '../requestMethods';


const Container = styled.div``;

const Wrapper = styled.div`
    padding: 50px;
    display: flex;
    ${mobile({ padding: '10px', flexDirection: 'column' })}
`;

const ImgContainer = styled.div`
    flex: 1;
`;


const Image = styled.img`
    width: 100%;
    height: 90vh;
    object-fit: cover;
    ${mobile({ height: '40vh', flexDirection: 'column' })}
`;

const InfoContainer = styled.div`
    flex: 1;
    padding: 0px 50px;
    ${mobile({ padding: '10px' })}
`;

const Title = styled.h1`
    font-weight: 200;
`;

const Desc = styled.p`
    margin: 20px 0px;
`;

const Price = styled.span`
    font-weight: 100;
    font-size: 40px;
`;

const FilterContainer = styled.div`
    display: flex;
    width: 50%;
    margin: 30px 0px;
    justify-content: space-between;
    ${mobile({ width: '100%' })}
`;

const Filter = styled.div`
    display: flex;
    align-items: center;
    padding: 10px;
`;

const FilterTitle = styled.span`
    font-size: 20px;
    font-weight: 200;
`;

const FilterColor = styled.div`
    width: 20px;
    height: 20px;
    border-radius: 50%;
    margin: 0 5px;
    background-color: #${props => props.color};
    cursor: pointer;
`;

const AddContainer = styled.div`
    display: flex;
    flex-wrap: wrap;
    align-items: center;
    justify-content: space-around;
    ${mobile({ width: '100%' })}
`;

const AmountContainer = styled.div`
    display: flex;
    align-items: center;
    font-weight: 700;
`;

const Amount = styled.span`
    width: 100px;
    border: 1px solid teal;
    align-items: center;
    justify-content: center;
    margin: 0 10px;
    padding: 14px;
    text-align: center;
    font-weight: 500;
`;

const Button = styled.button`
    padding: 15px;
    margin-top: 0 5px;
    border: 2px solid teal;
    background-color: white;
    cursor: pointer;
    font-weight: 500;
    &:hover {
        background-color: #f8f4f4;
    }
`;

const BuyNowButton = styled.button`
    padding: 15px;
    border: 2px solid teal;
    background-color: teal;
    color: white;
    width: 90%;
    margin-top: 20px;
    cursor: pointer;
    font-weight: 500;
    &:hover {
        background-color: #4e8773;
    }
`;

const Product = () => {
    const location = useLocation();
    const id = location.pathname.split("/")[2];
    console.log(id);
    const [product, setProduct] = useState({});

    useEffect(() => {
        const getProduct = async () => {
            try {
                const res = await publicRequest.get('/products/find/' + id)
                console.log(res.data);
                setProduct(res.data)
            } catch {}
        };
        getProduct();
    }, [id])
    console.log(product);
  return (
    <Container>
      <Navbar />
      <Announcement />
      <Wrapper>
        <ImgContainer>
            <Image src={require(`../sources/images/${product.img}`)} />
        </ImgContainer>
        <InfoContainer>
            <Title>Isabella</Title>
            <Desc>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Quaerat nisi vel at commodi, doloribus voluptatum eos enim quisquam aut delectus architecto. A at aspernatur enim perferendis? Temporibus officiis obcaecati quidem.</Desc>
            <Price>UAH 20 PER 1 KG</Price>
            <FilterContainer>
                <Filter>
                    <FilterTitle>Color</FilterTitle>
                    <FilterColor color='6f2da8'/>
                    <FilterColor color='A6BE47'/>
                </Filter>
            </FilterContainer>
            <AddContainer>
                <AmountContainer>
                    <RemoveIcon />
                    <Amount>100 kg</Amount>
                    <AddIcon />
                </AmountContainer>
                <Button>ADD TO CART</Button>
                <BuyNowButton>BUY NOW</BuyNowButton>
            </AddContainer>
        </InfoContainer>
      </Wrapper>
      <Newsletter />
      <Footer />
    </Container>
  )
}

export default Product
